　ティラノサウルス◎プレミアムエディション特大サイズフィギュア ソフトビニールモデル☆恐竜グッズ通販☆(夏休み/自由研究/理科)◆<!-- ★お気に入り--><div class="w280-c"><div class="center-m-0a"><img class="item-oki-bn" alt="キャラクターグッズ通販シネマコレクションのお気に入りリストを確認する" src="http://image.rakuten.co.jp/cinemacollection/cabinet/oki-2.gif"></div></div><!-- ★お気に入りココまで--><!--★削除不可--></span></td></tr></table><br></td></tr></table><br><table cellpadding="0" border="0"><tr><td><table cellpadding="0" border="0"><tr><td><span><!--関連検索キーワード--><div style="width:100%;text-align: center"><h3 style="color:#7f7f7f;">フェバリット/T-REX/置物/玩具/柔らか/遊べる/通販</h3><img style="margin:15px 0 10px 0;width:100% ;border:none;" alt="キャラクターグッズ専門店/シネマコレクション/商品詳細" src="http://www.rakuten.ne.jp/gold/cinemacollection/bn/item-bn01.gif" /><div style="color:#7f7f7f;width:90%;margin:0 auto;#efefef solid 1px;padding:10px;text-align: left;">子供から大人まで大満足の【ティラノサウルス】フィギュア☆<br>メーカー史上最大級の50cmを超えるド迫力の超ビッグサイズ!!<br>柔らかなソフビ素材を使用しているので、落としても壊れない!!<br>造型・彩色監修は日本を代表する恐竜造形師 荒木一成氏<br>大きいだけじゃない、作り込まれたリアルなディテールにも注目☆<br>インテリアとしてもおススメ<br><br>■サイズ：約260×510×380mm</div></div><div style="width:100%;text-align: center;"><img style="margin:15px 0 10px 0;width:100% ;border:none;" alt="キャラクターグッズ専門店/シネマコレクション/詳細画像" src="http://www.rakuten.ne.jp/gold/cinemacollection/bn/item-bn02.gif" /><div style="width:100%;margin:0 auto;"><img width="260" hspace="2" vspace="2" border="0" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r1505-16/fvt-fd-351.jpg"><img width="260" hspace="2" vspace="2" border="0" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r1505-16/fvt-fd-351_2.jpg"><img width="260" hspace="2" vspace="2" border="0" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r1505-16/fvt-fd-351_3.jpg"><img width="260" hspace="2" vspace="2" border="0" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r1505-16/fvt-fd-351_4.jpg"><img width="260" hspace="2" vspace="2" border="0" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r1505-16/fvt-fd-351_5.jpg"></div></div><div style="width:100%;text-a